import { useState, useEffect } from 'react';
import axios from 'axios';
import Booking from '../components/booking/Booking';
import Thanks from './Thanks';
import NotAvailable from './NotAvailable';
import { Link } from 'react-router-dom';

const Home = () => {
  const [travelers, setTravelers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch data from API using Axios
    axios.get('your_api_endpoint')
      .then(response => {
        setTravelers(response.data); // Assuming response.data is an array of traveler objects
        setLoading(false);
      })
      .catch(error => {
        setError(error);
        setLoading(false);
      });
  }, []);

  return (
    <div className="max-w-5xl px-6 pt-8 pb-10 w-full mx-auto bg-white rounded-lg drop-shadow">
      {loading ? (
        <div>Loading...</div>
      ) : error ? (
        <div>Error: {error.message}</div>
      ) : travelers.length === 0 ? (
        <NotAvailable />
      ) : (
        travelers.map(traveler => (
          <div key={traveler.id} className="card">
            {/* Render traveler information in a card */}
            <h2>{traveler.name}</h2>
            <p>{traveler.description}</p>
            {/* You can add more information here */}
          </div>
        ))
      )}
    </div>
  );
};

export default Home;
